import React from "react";
import { Menu } from "antd";
import styled from "styled-components";

const HeaderWrapper = styled.header`
  display: flex;
  align-items: center;
  justify-content: space-between;
  padding: 0 24px;
  height: 64px;
  background-color: #000;
  color: #fff;
`;

const Logo = styled.div`
  font-size: 1.5rem;
  font-weight: bold;
  color: #fff;
`;

const StyledMenu = styled(Menu)`
  background-color: transparent;

  & .ant-menu-item {
    color: #fff;
  }

  & .ant-menu-item:hover {
    color: #4096ff;
  }
`;

// 컴포넌트 정의
const Header = () => {
  return (
    <HeaderWrapper>
      <Logo>MyLogo</Logo>

      <StyledMenu
        theme="dark"
        mode="horizontal"
        items={[
          { key: "1", label: "Home" },
          { key: "2", label: "About" },
          { key: "3", label: "Contact" },
        ]}
      />
    </HeaderWrapper>
  );
};

export default Header;
